import React, { Component } from 'react'

import { N } from 'react-router-dom'
export class Menu extends Component {
    

    render() {
        return (
            <>
            <N  to="/">Home</N><br/>
            <N  to="/2">About</N><br/>
            <N  to="/1">Contact</N>
         
            </>
        )
    }
}

export default Menu
